import Button from '@mui/material/Button';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
const ProductLSideView = (props) => {
    const data = props.products;
    console.log('data:', data);
    return (
        <>
            <div style={{ border: '1px solid red', paddingLeft: '10px' }}>
                <img src={data.detailUrl} alt="" sizes="" srcset="" />

                <Row>
                    <Col lg={12} md={12} sm={6} xs={6}>
                        <Button
                            style={{
                                backgroundColor: '#fb641b',
                                width: '100%',
                                color: 'white',
                                height: '55px',
                                borderRadius: '0px',
                            }}
                        >
                            ADD TO CART
                        </Button>
                    </Col>
                    <Col lg={12} md={12} sm={6} xs={6}>
                        <Button
                            style={{
                                backgroundColor: '#f86418',
                                width: '100%',
                                color: 'white',
                                height: '55px',
                            }}
                        >
                            BUY NOW
                        </Button>
                    </Col>
                </Row>
            </div>
        </>
    );
};

export default ProductLSideView;
